    false,nt"url": null,nt"notes": "NODC Accession 0083196 includes chemical,
    physical and underway - surface data collected from LAURENCE M. GOULD in the Caribbean
    Sea, North Pacific Ocean, South Atlantic Ocean and South Pacific Ocean from 2002-03-07
    to 2012-11-24 and retrieved during cruise R/V Laurence M. Gould Lines. These data
    include Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE
    TEMPERATURE. The instruments used to collect these data include Carbon dioxide (CO2)
    gas analyzer and Shower head chamber equilibrator for autonomous carbon dioxide
    (CO2) measurement. These data were collected by Taro Takahashi and S. Sutherland
    of Columbia University; Lamont-Doherty Earth Observatory and Colm Sweeney of University
    of Colorado At Boulder; Cooperative Institute for Research In Environmental Sciences
    as part of the R/V Laurence M. Gould Lines data set.nnThe Global Volunteer Observing
    Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
    Project (IOCCP). International groups from 14 countries have been outfitting research
    ships and commercial vessels with automated CO2 sampling equipment to analyze the
    carbon exchange between the ocean and atmosphere.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
